import torch

try:
    from fast_hadamard_transform import hadamard_transform
except ImportError:
    print(f"fast_hadamard_transform not found")

def is_pow2(n):
    return (n & (n - 1) == 0) and (n > 0)

@torch.no_grad()
def get_hadamard(n, transpose=False):
    hadamard_K, K = None, None
    if n == 14336: # 14336 = 28 * 512
        K = 28
        hadamard_K = hadamard_matrix_28().T if transpose else hadamard_matrix_28()
    elif n == 11008: # 11008 = 43 * 256
        K = 172
        hadamard_K = hadamard_matrix_172().T if transpose else hadamard_matrix_172()
    elif n == 3072: # 3072 = 3 * 1024
        K = 12
        hadamard_K = hadamard_matrix_12().T if transpose else hadamard_matrix_12()
    elif n == 9216: # 9216 = 9 * 1024
        K = 36
        hadamard_K = hadamard_matrix_36().T if transpose else hadamard_matrix_36()
    elif n == 36:
        K = 36
        hadamard_K = hadamard_matrix_36().T if transpose else hadamard_matrix_36()
    elif is_pow2(n):
        K = 1
    assert K is not None, f"Unsupported size {n}"
    return hadamard_K, K

def apply_hadamard(X, transpose=False):
    og_dev = X.device
    og_dtype = X.dtype
    X = X.float()
    # for pow2, hadamard_transform() already symmetric
    n = X.shape[-1]
    hadamard_K, K = get_hadamard(n, transpose)
    #print(f'{K=}, {n=}, {X.shape=}')
    if K == 1:
        return hadamard_transform(X.contiguous(), 1/(n**0.5)).to(og_dtype)

    input = X.view(-1, K, n // K)
    input = hadamard_transform(input.contiguous(), 1/(n**0.5))
    input = hadamard_K.to(input.device).float() @ input
    return input.to(og_dev).to(og_dtype).reshape(X.shape)

def apply_hadamard_old(X, transpose=False):
    # for pow2, hadamard_transform() already symmetric
    n = X.shape[-1]
    hadamard_K, K = get_hadamard(n, transpose)
    #print(f'{K=}, {n=}, {X.shape=}')
    if K == 1:
        # return hadamard_transform(X.contiguous()) / torch.tensor(n).sqrt()
        return hadamard_transform(X.contiguous(), 1/(n**0.5))

    input = X.float().cuda().view(-1, K, n // K)
    input = hadamard_transform(input.contiguous(), 1/(n**0.5))
    input = hadamard_K.to(input.device).to(input.dtype) @ input
    # return input.to(X.device).to(X.dtype).reshape(X.shape) / torch.tensor(n).sqrt()
    return input.to(X.device).to(X.dtype).reshape(X.shape)

@torch.no_grad()
def RHT(W, S_in, S_out):
    return apply_hadamard(
        apply_hadamard(W.T * S_out, transpose=True).T * S_in, transpose=True)

@torch.no_grad()
def RHT_inv(W, S_in, S_out):
    return (
        apply_hadamard( (apply_hadamard(W) * S_in).T ) * S_out
    ).T

@torch.no_grad()
def RHT_H(H, S_in):
    return apply_hadamard(
        apply_hadamard(H * S_in, transpose=True).T * S_in, transpose=True)

def quant_linear(x, W, bias, S_in, S_out):
    out = apply_hadamard(x * S_in, transpose=True) @ W.T
    return apply_hadamard(out) * S_out + bias

